import { useState } from 'react';
import { Grid, List, Search } from 'lucide-react';
import PlayerCard from '../components/PlayerCard';
import { players } from '../data/players';

const MainPage = ({ navigateToPage }) => {
  const [viewMode, setViewMode] = useState('grid');
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedTeam, setSelectedTeam] = useState('جميع الأندية');
  const [selectedAge, setSelectedAge] = useState('جميع الأعمار');

  const filteredPlayers = players.filter(player => {
    const matchesSearch = player.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         player.team.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesTeam = selectedTeam === 'جميع الأندية' || player.team === selectedTeam;
    const matchesAge = selectedAge === 'جميع الأعمار' || 
                      (selectedAge === '20-25' && player.age >= 20 && player.age <= 25) ||
                      (selectedAge === '26-30' && player.age >= 26 && player.age <= 30);

    return matchesSearch && matchesTeam && matchesAge;
  });

  return (
    <div className="min-h-screen bg-gray-50">
      <div className="p-6">
        {/* Search and Filters */}
        <div className="flex justify-between items-center mb-6">
          <div className="flex items-center">
            <div className="border rounded-md p-2 flex items-center bg-white w-64">
              <Search size={16} className="ml-2 text-gray-400" />
              <input 
                type="text" 
                placeholder="البحث عن لاعب..." 
                className="outline-none bg-transparent w-full"
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
              />
            </div>
          </div>
          <div className="flex items-center space-x-4 space-x-reverse">
            <button className="hover:text-green-700 focus:outline-none">المنطقة</button>
            <button className="hover:text-green-700 focus:outline-none">النادي</button>
            <button className="hover:text-green-700 focus:outline-none">الإحصائيات</button>
          </div>
        </div>

        {/* Title and Filters */}
        <div className="flex justify-between items-center mb-6">
          <div className="flex items-center">
            <h1 className="text-xl font-bold ml-4">اللاعبون المميزون</h1>
            <select 
              className="border rounded-md p-2 mx-2"
              value={selectedTeam}
              onChange={(e) => setSelectedTeam(e.target.value)}
            >
              <option>جميع الأندية</option>
              <option>النصر</option>
              <option>الهلال</option>
              <option>الاتحاد</option>
            </select>
            <select 
              className="border rounded-md p-2 mx-2"
              value={selectedAge}
              onChange={(e) => setSelectedAge(e.target.value)}
            >
              <option>جميع الأعمار</option>
              <option>20-25</option>
              <option>26-30</option>
            </select>
          </div>
          <div className="flex border rounded-md">
            <button 
              className={`p-2 ${viewMode === 'grid' ? 'bg-gray-100' : 'bg-white'}`}
              onClick={() => setViewMode('grid')}
            >
              <Grid size={16} />
            </button>
            <button 
              className={`p-2 ${viewMode === 'list' ? 'bg-gray-100' : 'bg-white'}`}
              onClick={() => setViewMode('list')}
            >
              <List size={16} />
            </button>
          </div>
        </div>

        {/* Players Grid */}
        <div className={viewMode === 'grid' ? 'grid grid-cols-3 gap-6' : 'space-y-4'}>
          {filteredPlayers.map(player => (
            <PlayerCard
              key={player.id}
              player={player}
              onClick={() => navigateToPage('playerDetails', player)}
            />
          ))}
        </div>
      </div>
    </div>
  );
};

export default MainPage;
